import React, { Component } from 'react';


const ErrorMessage = {
    color: "white",
    fontSize: "13px"
  }

class Header extends Component {
  render() {
    return (
      <div className="header" style={ErrorMessage}>
        <h1>Header</h1>
      </div>
    );
  }
}

export default Header;
